function Searchbar(){
    return(
        <div class=" bg-gray-200">

                <div class="relative"> <input type="text" class="h-14 w-96  rounded z-0 focus:shadow focus:outline-none" placeholder="Search anything..."/>
                    <div class="absolute top-4 right-3"> <i class="fa fa-search text-gray-400 z-20 hover:text-gray-500"></i> </div>

            </div>
        </div>
    );
}
export default Searchbar;
